import React from 'react';
import { Button } from '@mui/material';

function SideBar() {
  return (
    <div>
    <Button onClick={toggleDrawer(true)}>Open drawer</Button>
    <Drawer open={open} onClose={toggleDrawer(false)}>
      {DrawerList}
    </Drawer>
  </div>
  )
}

export default SideBar
